// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./quickint.sol";
contract Combine{}

    contract ZombieMint is Ownable, ERC721 {

        constructor(string memory _name, string memory _symbol)
         ERC721(_name, _symbol) {}

        //Comb2 Contract;
        Combine combine2;
        address private combine2Address;
        //Brain Coin
        IERC20 pacoCoin;
        address pacoAddress; 

        // Struct
        struct Zombie {
            uint strength;
            uint id;
            uint level;
            uint rarity;
            uint hunger;
            bool inSquad;
        }
        
        //Array
        Zombie[] zombies;

        //Mappings
        mapping(address => bool) public mintStatus; // Event mapping - to confirm

        mapping(uint => address) public idOwner;    // What index belongs to what wallet. (3 - 0x123)
        mapping(address => uint) public howMany;    // How many nfts the address owns. (0x123 - 13) 
        mapping(address => uint) public strength;   // How much strength in total the address has (0x113 - 8)

        //Events -- need more
        event payedFee(address user);           // User Payed the fee for the oracle to mint him an nft.
        event minted(uint id, uint randNum);    // Oracle minted him a nft. --- Make backdoor for only owner to mint back in case of Overflow.

        //Mint function -----------------------------------------------------------------
        uint counter = 0;
        function _minting(address _add, uint _rand ) public onlyOracle { // Later check, how many blocks have passed. 
            mintStatus[_add] = false;
            uint q = _determineRarity(_rand);
            Zombie memory newZmb = Zombie(q, counter, 1, q, 10, false);
            zombies.push(newZmb);
            pop(_add, counter);
            idOwner[counter] = _add;
            howMany[_add]++;
            strength[_add] += q;
            emit minted(counter, q);
            counter ++;
        }

        function mintFree() public {            // make sure to delete later.
            Zombie memory newZmb = Zombie(1, counter, 1, 1, 10, false);
            zombies.push(newZmb);
            pop(msg.sender, counter);
            idOwner[counter] = msg.sender;
            howMany[msg.sender]++;
            strength[msg.sender] += 1;
            emit minted(counter, 1);
            counter ++;
        }

        //Pay function  -------------------------------------------------------------
        uint public brainPrice;       // Needs to be update by oracle constantly.
        uint public brainTest = 250;    // delete later.

        function payForNft() public payable {       // Mint with Eth
            require(msg.value == 0.01 ether);
            mintStatus[msg.sender] = true;
            emit payedFee(msg.sender);
        }

        function payWithBr() public payable {       // Can only pay after having set allowance for contract to spend tokens.
            require(pacoCoin.allowance(msg.sender, address(this)) >= brainTest, "Not enought coins or allowance.");
            require(pacoCoin.balanceOf(msg.sender) >= brainTest, "Balance not enought.");
            uint priceInWei = brainTest * 10 ** 18;
            require(pacoCoin.transferFrom(msg.sender, address(this), priceInWei), "Transfer Failed.");
            emit payedFee(msg.sender);
        }

        // Oracle Manip -------------------------------------------------------------------------------------

        // Helpers -------------------------------------------------------------------------------------------
        function _determineRarity(uint _rand) internal pure returns(uint){ 
            // this function just filters the random number recieved from the oracle & filters it for mint.
            // Determines Rarity of Zombie.
            uint rarity;
            if(_rand <= 75) {
                rarity = 1;
            } else if(_rand <= 95) {
                rarity = 2;
            } else if(_rand >= 95) {
                rarity = 3;
            }
            return rarity;
        }
        
        // Getters
        function getIds() public view returns(uint[] memory) { // Gets array of Ids.
            uint num = 0;
            uint[] memory result = new uint[](howMany[msg.sender]);
            for(uint i = 0; i < zombies.length; i++) {
                if(idOwner[i] == msg.sender) {
                    result[num] = i;
                    num++;
                }
            }
            return result;
        }

        function getStr() public view returns(uint[] memory) { // Gives zombie Strength in Array.
            uint num = 0;
            uint[] memory result = new uint[](howMany[msg.sender]);
            for(uint i = 0; i < zombies.length; i++) {
                if(idOwner[i] == msg.sender) {
                    result[num] = zombies[i].strength;
                    num++;
                }
            }
            return result;
        }

        function getRar() public view returns(uint[] memory) { // Gives zombie Rarity in Array.
            uint num = 0;
            uint[] memory result = new uint[](howMany[msg.sender]);
            for(uint i = 0; i < zombies.length; i++) {
                if(idOwner[i] == msg.sender) {
                    result[num] = zombies[i].rarity;
                    num++;
                }
            }
            return result;
        }

        function getStuffA(uint _id) public view returns(uint[] memory) {
            // Returns (Strength, Level, Rarity, Hunger of provided Id.)
        uint[] memory result = new uint[](4);
        uint index = 0;
        result[index] = zombies[_id].strength; 
        result[index + 1] = zombies[_id].level;
        result[index + 2] = zombies[_id].rarity;
        result[index + 3] = zombies[_id].hunger;
        return result;
    }

        function getIfInSquad(uint _id) public view returns(bool) { // Returns bool if Zombie is in Squad alr.
            return zombies[_id].inSquad;
        }


        // Game Contract --Exports ---------------------
        function strr(address _add) external view returns (uint) {
            uint x = strength[_add];
            return x;
    }

        function getAmount(address _add) external view returns (uint) {
            uint x = howMany[_add];
            return x;
    }
        // ---------------------------------------------------


        //security ~logic
        function pop(address to, uint256 tokenId) internal virtual {
            _mint(to, tokenId);
            require(_checkOnERC721Received(address(0), to, tokenId), "not today");
        }

        function isContract(address account) internal view returns(bool) {
            return account.code.length > 0;
        }

        function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId
    ) private returns (bool) {
        if (isContract(to)) {
            try IERC721Receiverr(to).onERC721Received(_msgSender(), from, tokenId) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

        // Setters ------------- Need to set these addresses after deployment.
        function setPacoCoin(address _add) public onlyOwner {
                pacoCoin = IERC20(_add);
                pacoAddress = _add;
            }

        function setCombine2(address _add) public onlyOwner {
            combine2 = Combine(_add);
            combine2Address = _add;
        }

        //Modifier address -- setter -- Makes it so that only the oracle address can call the mint function for extra security.
        function setOracleAddress(address _add) public onlyOwner {
            Oracle = _add;
        }

        address private Oracle;

        modifier onlyOracle() {
            require(msg.sender == Oracle);
            _;
        }

        modifier onlyCombine() {
        require(msg.sender == combine2Address, "You arent a contract.");
        _;
    }

    // Combine2 exports ----------------------------------------------------------------

        // Returns strength of given id's zombie.
        function getStr(uint _id) external view returns(uint){
            return zombies[_id].strength;
        }

        // Returns bool after comparing if the _id & address are in idOwner mapping.
        function verifyIds(uint _id, address _add) external view returns(bool) {
            return (_add == idOwner[_id]);
        }

        //Returns bool of "inCrew" from the given id's zombie.
        function checkIfInCrew(uint _id) external view returns(bool){
            return zombies[_id].inSquad;
        }

        // Combine 2 setter function  needs to be onlyCombin2 modified ------------------------------------
        function setCrew(uint _id) external onlyCombine {
            zombies[_id].inSquad = !zombies[_id].inSquad;
        }



    }

