contracts/carContract.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./quickint.sol";

contract Combine {}

contract CarMint is Ownable, ERC721 {

    constructor(string memory _name, string memory _symbol)
    ERC721(_name, _symbol) {}

    //Comb2 Contract;
    Combine combine2;
    address private combine2Address;
    //Brain Coin
    IERC20 pacoCoin;
    address pacoAddress;     

    // Struct
    struct Car {
        uint rairty;
        uint cap;
        uint counter;
        bool inCrew;
    }

    //Array
    Car[] public cars;

    //Mappings
    mapping(uint => address) public idOwner;    // What index belongs to what wallet. (3 - 0x123)
    mapping(address => uint) public howMany;    // How many nfts the address owns. (0x123 - 13) 

    mapping(address => bool) public mintStatus; // Event mapping - to confirm
    //Events
    event payedFee(address user);
    event minted(uint id, uint randNum);

    //Minting Functions ----------------------
    uint counter = 0;
    function _minting(address _add, uint _rand) public onlyOracle {
        mintStatus[_add] = false;
        uint rand = _determineRarity(_rand);
        Car memory newCar = Car(rand, rand + 1, 1, false);
        cars.push(newCar);
        pop(_add, counter);
        idOwner[counter] = _add;
        howMany[_add]++;
        emit minted(counter, rand);
        counter++;
    }

    function mintFree() public {
        Car memory newCar = Car(1, 1 + 1, 1, false);
        cars.push(newCar);
        pop(msg.sender, counter);
        idOwner[counter] = msg.sender;
        howMany[msg.sender]++;
        emit minted(counter, 1);
        counter ++;
    }

    //Pay function  -------------------------------------------------------------
    uint public brainPrice;
    uint public brainTest = 400;

    function payWithBr() public payable {
        require(pacoCoin.allowance(msg.sender, address(this)) >= brainTest, "Not enought coins or allowance.");
            require(pacoCoin.balanceOf(msg.sender) >= brainTest, "Balance not enought.");
            uint priceInWei = brainTest * 10 ** 18;
            require(pacoCoin.transferFrom(msg.sender, address(this), priceInWei), "Transfer Failed.");
            emit payedFee(msg.sender);
    }

    // Helpers -------------------------------------------------------------------------------------------
        function _determineRarity(uint _rand) internal pure returns(uint){ 
            // this function just filters the random number recieved from the oracle & filters it for mint.
            // Determines Rarity of Zombie.
            uint rarity;
            if(_rand <= 75) {
                rarity = 1;
            } else if(_rand <= 95) {
                rarity = 2;
            } else if(_rand >= 95) {
                rarity = 3;
            }
            return rarity;
        }

    //security ~logic ---------------
        function pop(address to, uint256 tokenId) internal virtual {
            _mint(to, tokenId);
            require(_checkOnERC721Received(address(0), to, tokenId), "not today");
        }

        function isContract(address account) internal view returns(bool) {
            return account.code.length > 0;
        }

        function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId
    ) private returns (bool) {
        if (isContract(to)) {
            try IERC721Receiverr(to).onERC721Received(_msgSender(), from, tokenId) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }


    // Setters 

    //Modifier address -- setter -- Makes it so that only the oracle address can call the mint function for extra security.
        function setOracleAddress(address _add) public onlyOwner { // Sets oracle wallet for minting from cloud.
            Oracle = _add;
        }

        address private Oracle;

        function setPacoCoin(address _add) public onlyOwner {
                pacoCoin = IERC20(_add);
                pacoAddress = _add;
            }

        modifier onlyOracle() {
            require(msg.sender == Oracle);
            _;
        }

        function setCombine2(address _add) public onlyOwner {   // Sets combine contract.
            combine2 = Combine(_add);
            combine2Address = _add;
        }

    // Combine2 exports -----------------------------------

    function getCapOfCarById(uint _id) external view returns(uint){ //returns the cap of the given id's car.
        uint x = cars[_id].cap;
        return x;
    }

    // grabs value in "inCrwe"-bool
    function getCrewStatus(uint _id) external view returns(bool){ // returns the bool "inCrew" of the given id's car.
        return cars[_id].inCrew;
    }

    // checks if address is owner of id
    function ownerOfId(uint _id, address _add) external view returns(bool){
        return (idOwner[_id] == _add);
    }

    // Combine 2 setters need modifier -------------------------------------------
    modifier onlyCombine2() {
        require(msg.sender == combine2Address, "You arent a contract.");
        _;
    }
    // Sets status on "inCrew"-bool
    function setCarCrew(uint _id) external onlyCombine2{
        cars[_id].inCrew = !cars[_id].inCrew;
    }    
}

